import React from "react";
import { takeRandomUnit } from "./units/Units";
import "./App.css";

const App: React.FC = () => {
  const rederCell = (position: number): any => {
    let unit: any = takeRandomUnit();
    return (
      <div className="cell">
        <button className="frame ">
          <img className="image" src={unit._imgPath} alt="img" width={200} />
          <progress value={20} max={unit._HP}></progress>
        </button>
      </div>
    );
  };
  const renderField = (): any => {
    return (
      <div className="battleField">
        <div className="row">
          <div>{rederCell(1)}</div>
          <div>{rederCell(2)}</div>
          <div>{rederCell(3)}</div>
        </div>
        <div className="row">
          <div>{rederCell(4)}</div>
          <div>{rederCell(5)}</div>
          <div>{rederCell(6)}</div>
        </div>

        <div className="row">
          <div>{rederCell(7)}</div>
          <div>{rederCell(8)}</div>
          <div>{rederCell(9)}</div>
        </div>
        <div className="row">
          <div>{rederCell(10)}</div>
          <div>{rederCell(11)}</div>
          <div>{rederCell(12)}</div>
        </div>
      </div>
    );
  };
  return <div className="app">{renderField()}</div>;
};

export default App;
